import React from 'react'
import './SignIn.css'
import logo from '../img/logo.jpeg'
export default function SignIn() {
  return (
    <div className='signIn'>
      <div className='loginForm'>
      <img className='signUpLogo' alt='' src={logo} />
      </div>
      
    </div>
  )
}
